import { useEffect, useState } from "react";
import api from "../services/api.js";
import Container from '@mui/material/Container';
import styled from "styled-components";

const Box = styled.div`
  display: flex;
  margin: 20px 20px
  padding: 10px

`

function Usuarios(params) {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    api.get("users").then((response) => {
      console.log("motor", response.data);
      setUsers(response.data);
    });
  }, []);

  return (
    
      <Container sx={{ width:'1500px', height:"500px", flexDirection: 'row' ,alignItems:'center' , justifyContent: 'space-between' }}>
        
        {users.map((user) => (
          <Box>

            <div key={user.id}>Name :{user.name}</div>
            <div key={user.id}>Email:{user.email}</div>
            
          </Box>
        ))}
      </Container>
    
  );
}

export default Usuarios;
